import React from 'react'
import Nav from './Nav'
import Header from './Header'
import Particles from 'react-particles-js'

const Home = () => {
    return (
        <div>
            <Particles
            params={{
                particles: {
                    number: {
                        value: 45
                    }
                }
            }}
            />
            <Nav />
            <Header />
        </div>
    )
}

export default Home;
